var Offer = require('./data/Offer');
var User = require('./data/User');
var mongoose = require('mongoose');
var async = require('async');
var log = require("./util/log");

function generateTestData(user) {
    var userId = mongoose.Types.ObjectId(user);
    var UserModel = {
        _id: userId,
        skips: [],
        offers: [],
        requests: []
    };

    var count = 0;

    async.whilst(
        function () {
            return count < 100;
        },
        function (callback) {
            Offer.create({
                user: userId,
                title: 'Mow my law',
                description: "Would be awesome if you could mow my law",
                image: "data:image/jpeg;base64,",
                deadline: new Date(Date.UTC(2016, 5, 30, 22, 0, 0)),
                payment: {
                    type: "SERVICE",
                    value: "Repair PC"
                },
                location: [14.510034, 48.346371],
            }, function (err, offer) {
                if (err) {
                    callback(err, count);
                }
                UserModel.offers.push(offer._id)
                count++;
                callback(null, count);
            });
        },
        function (err, n) {
            if (err) {
                log.error("Error creating testdata: " + err);
                return;
            }
            User.create(UserModel, function (err) {
                if (err) {
                    log.error("Error creating testdata: " + err);
                    return;
                }
                log.info("Test data generated");
            });
        }
    );

}


module.exports = {
    generate: generateTestData
}